u0430\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1559_%D0%B3%D0%BE%D0%B4\" title=\"1559 \u0433\u043e\u0434\">1559<\/a>&#160;\u2014 \u0420\u0438\u0436\u0441\u043a\u0438\u0439 \u0430\u0440\u0445\u0438\u0435\u043f\u0438\u0441\u043a\u043e\u043f \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b\u0441\u044f \u043a \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043d\u043e\u043c\u0443 \u0432 \u043a\u043e\u043d\u0446\u0435 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B2%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD\" title=\"\u0422\u0435\u0432\u0442\u043e\u043d\u0441\u043a\u0438\u0439 \u043e\u0440\u0434\u0435\u043d\">\u0422\u0435\u0432\u0442\u043e\u043d\u0441\u043a\u0438\u043c \u043e\u0440\u0434\u0435\u043d\u043e\u043c<\/a> \u0438 \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u043c \u043a\u043e\u0440\u043e\u043b\u0451\u043c \u0438 \u0412\u0435\u043b\u0438\u043a\u0438\u043c \u041a\u043d\u044f\u0437\u0435\u043c \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B3%D0%B8%D0%B7%D0%BC%D1%83%D0%BD%D0%B4_II_%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82\" title=\"\u0421\u0438\u0433\u0438\u0437\u043c\u0443\u043d\u0434 II \u0410\u0432\u0433\u0443\u0441\u0442\">\u0421\u0438\u0433\u0438\u0437\u043c\u0443\u043d\u0434\u043e\u043c II \u0410\u0432\u0433\u0443\u0441\u0442\u043e\u043c<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432 \u0434\u0430\u043d\u043d\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u043b \u043a\u0430\u043a \u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u043a\u043d\u044f\u0437\u044c \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u0439. \u0412 \u043e\u0431\u043c\u0435\u043d \u043d\u0430 \u0437\u0430\u0449\u0438\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u041b\u0438\u0432\u043e\u043d\u0438\u044f\">\u041b\u0438\u0432\u043e\u043d\u0438\u0438<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0430\u0440\u0445\u0438\u0435\u043f\u0438\u0441\u043a\u043e\u043f \u0443\u0441\u0442\u0443\u043f\u0430\u043b \u0441\u0432\u043e\u0438 \u0432\u0430\u0436\u043d\u0435\u0439\u0448\u0438\u0435 \u0437\u0430\u043c\u043a\u0438 \u0432 \u044e\u0436\u043d\u043e\u0439 \u041b\u0438\u0432\u043e\u043d\u0438\u0438 (\u041a\u043e\u043a\u0435\u043d\u0433\u0443\u0437\u0435\u043d \u0438 \u0434\u0440.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1776_%D0%B3%D0%BE%D0%B4\" title=\"1776 \u0433\u043e\u0434\">1776<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0435<\/a> \u0432\u043e\u0439\u0441\u043a\u0430 \u043e\u043a\u043a\u0443\u043f\u0438\u0440\u043e\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>, \u0435\u0434\u0432\u0430 \u043d\u0435 \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u0432 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d, \u0414\u0436\u043e\u0440\u0434\u0436\">\u0414\u0436\u043e\u0440\u0434\u0436\u0430 \u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1784_%D0%B3%D0%BE%D0%B4\" title=\"1784 \u0433\u043e\u0434\">1784<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044c \u041d\u0435\u0430\u043f\u043e\u043b\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u043e\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D0%B8%D0%BD%D1%87%D0%B5%D0%BD%D1%86%D0%BE_%D0%9B%D1%83%D0%BD%D0%B0%D1%80%D0%B4%D0%B8&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u0438\u043d\u0447\u0435\u043d\u0446\u043e \u041b\u0443\u043d\u0430\u0440\u0434\u0438 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0412\u0438\u043d\u0447\u0435\u043d\u0446\u043e \u041b\u0443\u043d\u0430\u0440\u0434\u0438<\/a> (Vincenzo Lunardi) \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0410\u043d\u0433\u043b\u0438\u0438 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D1%81%D1%82%D0%B0%D1%82\" title=\"\u0410\u044d\u0440\u043e\u0441\u0442\u0430\u0442\">\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u043c \u0448\u0430\u0440\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1792_%D0%B3%D0%BE%D0%B4\" title=\"1792 \u0433\u043e\u0434\">1792<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d<\/a> (\u0431\u0443\u0434\u0443\u0449\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u04