0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439. \u0411\u044b\u043b\u0438 \u0442\u0430\u043a\u0436\u0435 \u0443\u0437\u0430\u043a\u043e\u043d\u0435\u043d\u044b \u0440\u0430\u0437\u0433\u0440\u043e\u043c \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u0430 \u043f\u043e\u043b\u0438\u0446\u0438\u0438, \u0430\u0440\u0435\u0441\u0442 \u0447\u043b\u0435\u043d\u043e\u0432 \u0421\u043e\u0432\u0435\u0442\u0430 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432, \u0443\u043f\u0440\u0430\u0437\u0434\u043d\u0435\u043d\u044b \u043a\u0430\u0442\u043e\u0440\u0433\u0430 \u0438 \u0441\u0441\u044b\u043b\u043a\u0430, \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0430 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0430\u043c\u043d\u0438\u0441\u0442\u0438\u044f. \u0411\u044b\u043b\u043e \u0442\u0430\u043a\u0436\u0435 \u043e\u0431\u0435\u0449\u0430\u043d\u043e \u0432\u0432\u0435\u0441\u0442\u0438 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0441\u0432\u043e\u0431\u043e\u0434\u044b, \u0441\u043e\u0437\u0432\u0430\u0442\u044c \u0423\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0412\u044b\u043f\u0443\u0449\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D1%80%D0%B1%D1%81_(%D0%B6%D1%83%D1%80%D0%BD%D0%B0%D0%BB)\" class=\"mw-redirect\" title=\"\u0424\u043e\u0440\u0431\u0441 (\u0436\u0443\u0440\u043d\u0430\u043b)\">\u0436\u0443\u0440\u043d\u0430\u043b\u0430 \u0424\u043e\u0440\u0431\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%9D%D0%B0%D