.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82\" title=\"\u0414\u0435\u043f\u0443\u0442\u0430\u0442\">\u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D1%82%D0%B0%D0%B3_(%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0)\" class=\"mw-redirect\" title=\"\u0420\u0435\u0439\u0445\u0441\u0442\u0430\u0433 (\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430)\">\u0440\u0435\u0439\u0445\u0441\u0442\u0430\u0433\u0430<\/a> \u0432 \u0432\u0438\u0434\u0443 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u043e\u043d \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D0%B8%D0%BD\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0438\u043d\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0438\u043d\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%B3%D0%BE%D0%B4%D0%B0,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u042f\u0433\u043e\u0434\u0430, \u0413\u0435\u043d\u0440\u0438\u0445 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0413\u0435\u043d\u0440\u0438\u0445 \u042f\u0433\u043e\u0434\u0430<\/a> \u0441\u043e\u043e\u0431\u0449\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u043b\u0438\u043d, \u0418\u043e\u0441\u0438\u0444 \u0412\u0438\u0441\u0441\u0430\u0440\u0438\u043e\u043d\u043e\u0432\u0438\u0447\">\u0421\u0442\u0430\u043b\u0438\u043d\u0443<\/a> \u043e \u0440\u0430\u0441\u043a\u0440\u044b\u0442\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4\" class=\"mw-redirect\" title=\"\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u00ab\u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u043f\u0435\u0434\u0435\u0440\u0430\u0441\u0442\u043e\u0432\u00bb. \u0410\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d\u043e \u0441\u0432\u044b\u0448\u0435 150 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u0410\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d \u0411\u0440\u0443\u043d\u043e \u0413\u0430\u0443\u043f\u0442\u043c\u0430\u043d\u043d (Bruno Richard Hauptmann), \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043e\u0431\u0432\u0438\u043d\u0438\u043b\u0438 \u0432 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u0435 \u0441\u044b\u043d\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%91%D1%82%D1%87%D0%B8%D0%BA\" title=\"\u041b\u0451\u0442\u0447\u0438\u043a\">\u043b\u0451\u0442\u0447\u0438\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BD%D0%B4%D0%B1%D0%B5%D1%80%D0%B3,_%D0%A7%D0%B0%D1%80%D0%BB%D1%8C%D0%B7\" title=\"\u041b\u0438\u043d\u0434\u0431\u0435\u0440\u0433, \u0427\u0430\u0440\u043b\u044c\u0437\">\u0427\u0430\u0440\u043b\u044c\u0437\u0430 \u041b\u0438\u043d\u0434\u0431\u0435\u0440\u0433\u0430<\/a> (\u0447\u0435\u0440\u0435\u0437 \u043f\u043e\u043b\u0442\u043e\u0440\u0430 \u0433\u043e\u0434\u0430 \u043a\u0430\u0437\